package leetcode;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

//https://leetcode.com/problems/valid-anagram/
public class ValidAnagram
{

    public static void main(String[] args)
    {
        String s1 = "";
        String s2 = "";

        String s3 = "anagram";
        String s4 = "nagaram";

        System.out.println(isAnagram2(s1, s2));
        System.out.println(isAnagram2(s3, s4));
    }

    public static boolean isAnagram(String s, String t)
    {

        Map<Character, Integer> src = new HashMap<>();
        Map<Character, Integer> tar = new HashMap<>();

        if (s.length() != t.length())
            return false;

        int count = 0;
        for (int i = 0; i < s.length(); i++)
        {
            count = src.containsKey(s.charAt(i)) ? (src.get(s.charAt(i)) + 1)
                                                 : 1;
            src.put(s.charAt(i), count);

            count = tar.containsKey(t.charAt(i)) ? (tar.get(t.charAt(i)) + 1)
                                                 : 1;
            tar.put(t.charAt(i), count);

        }

        for (Map.Entry<Character, Integer> entry : src.entrySet())
        {
            char ch = entry.getKey();
            if (tar.get(ch) == null || (tar.get(ch).intValue() != src.get(ch).intValue())) {
                return false;
            }
        }

        return true;
    }

    public static boolean isAnagram2(String s, String t)
    {
        if (s.length() != t.length())
            return false;

        char[] s1 = s.toCharArray();
        char[] s2 = t.toCharArray();

        Arrays.sort(s1);
        Arrays.sort(s2);

        for (int i = 0; i < s1.length; i++)
        {
            if (s1[i] != s2[i])
                return false;
        }

        return true;

    }

}
